06/09/2023 das 10:09 as 10:31 - Chegando no local foi feito o teste de velocidade da rede e passado ao suporte Pedro. User: Gilmaria téc: Marciel
Hoje dia 06/09/2023 foram realizados testes na rede do Ambulatório de Araguaína. Foi constatado que o sinal da claro que alimenta o modem está péssimo, mesmo com o modem configurado de acordo com as instruções da Claro. Foi passado ao cliente algumas soluções possíveis para o problema da unidade seriam:

1º: Entrar em contato com a operadora e questionar sobre a melhoria de sinal na área e solicitar uma visita técnica se possível;
2º: Trocar de operadora, da Claro para a VIVO; (Já adianto que a unidade em questão foi testada com um chip da VIVO, teve uma melhora em relação a Claro, mas não de forma significativa, mesmo com a troca pode ocorrer os mesmos problemas).
3º: Contratar um link dedicado para a unidade;

Também foi informado que os usuários do aplicativo que executam as ordens de serviço podem baixar as ordens antes de irem à unidade, em um local que tenha um sinal melhor, ir na unidade, executar a ordem de serviço e sincroniza-la posteriormente em um local que tenha um sinal melhor. Atualmente, mesmo que baixo o sinal da Claro, o link funciona para deixar o monitoramento ativo, ou seja, vai captar os usuários que forem na unidade, só que infelizmente o link não irá funcionar para executar as ordens de serviço. Agora será tratado pelo Ti interno da Porto.

